import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import { Login } from "Frontend/chatapp/src/components/navbar/login"
import { Navbar } from  "Frontend/chatapp/src/components/navbar/navbar"
function App() {

  return (
   <div className = "App">
    <Router>
      <Navbar />
      <Routes>
         <Route path ="/login" element={ <Login /> } />
      </Routes>

    </Router>
   </div>
  )
}

export default App;
